
CREATE TABLE [dbo].[Cities] (
    [Id]   INT           NOT NULL,
    [City] NVARCHAR (50) NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC)
);



CREATE TABLE [dbo].[AccountType] (
    [Id]    INT        NOT NULL,
    [Types] NCHAR (10) NOT NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC)
);



CREATE TABLE [dbo].[Busines] (
    [Id]               INT           NOT NULL,
    [OrganizationName] NVARCHAR (50) NULL,
    [INNCode]          BIGINT        NULL,
    [StatusId]         INT           NULL,
    [CityId]           INT           NULL,
    [FIO]              NVARCHAR (50) NULL,
    [PositionName]     NVARCHAR (50) NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC)
);



CREATE TABLE [dbo].[Credits] (
    [Id]             INT           NOT NULL,
    [AmountIssue]    MONEY         NULL,
    [RepayALoan]     MONEY         NULL,
    [MonthsPeriod]   INT           NULL,
    [OpenDate]       DATETIME2 (7) NULL,
    [NextDate]       DATETIME2 (7) NULL,
    [ClientId]       INT           NULL,
    [Rate]           INT           NULL,
    [MonthlyPayment] MONEY         NULL,
    [AccountNumber]  BIGINT        NULL,
    [Cash]           MONEY         NULL,
    [State]          BIT           NULL,
    [TypeId]         INT           NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC)
);


CREATE TABLE [dbo].[Customers] (
    [Id]       INT NOT NULL,
    [ClientId] INT NULL,
    [StatusId] INT NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC)
);



CREATE TABLE [dbo].[Deposit] (
    [Id]             INT           NOT NULL,
    [AccountNumber]  BIGINT        NULL,
    [Cash]           MONEY         NULL,
    [OpenDate]       DATETIME2 (7) NULL,
    [State]          BIT           NULL,
    [Capitalization] BIT           NULL,
    [DepositAmount]  MONEY         NULL,
    [MoneyEarned]    MONEY         NULL,
    [Rate]           INT           NULL,
    [ClientId]       INT           NULL,
    [MonthsPeriod]   INT           NULL,
    [DateClose]      DATETIME2 (7) NULL,
    [TypeId]         INT           NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC)
);

CREATE TABLE [dbo].[OperationHistory] (
    [Id]            INT           IDENTITY (1, 1) NOT NULL,
    [OperationId]   INT           NULL,
    [Money]         MONEY         NULL,
    [OperationDate] DATETIME2 (7) NULL,
    [AccountNumber] BIGINT        NULL,
    CONSTRAINT [PK_OperationHistory] PRIMARY KEY CLUSTERED ([Id] ASC)
);

CREATE TABLE [dbo].[Operations] (
    [Id]            INT        NOT NULL,
    [OperationName] NCHAR (35) NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC)
);


CREATE TABLE [dbo].[Personal] (
    [Id]            INT           NOT NULL,
    [ClientId]      INT           NULL,
    [OpenDate]      DATETIME2 (7) NULL,
    [AccountNumber] BIGINT        NULL,
    [Cash]          MONEY         NULL,
    [State]         BIT           NULL,
    [TypeId]        INT           NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC)
);

CREATE TABLE [dbo].[PhysicalClient] (
    [Id]             INT           NOT NULL,
    [Name]           NVARCHAR (50) NULL,
    [Surname]        NVARCHAR (50) NULL,
    [DateOfBirthday] DATETIME2 (7) NULL,
    [CityId]         INT           NULL,
    [StatusId]       INT           NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC)
);



CREATE TABLE [dbo].[Repayment] (
    [Id]            INT           NOT NULL,
    [CreditId]      INT           NULL,
    [RepaymentDate] DATETIME2 (7) NULL,
    [PlanningDate]  DATETIME2 (7) NULL,
    [Performed]     BIT           NULL,
    [Amount]        MONEY         NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC)
);

CREATE TABLE [dbo].[Statuses] (
    [Id]          INT           NOT NULL,
    [DepositRate] INT           NULL,
    [Status]      NVARCHAR (50) NULL,
    [CreditRate]  INT           NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC)
);




















